pragma solidity ^0.4.0;
contract Project_high_low
{
    uint256 game_id;
    struct  broker
    {
        uint256 st_amount;
    }
    mapping(address=>broker)br_map;
    address[] br_addr;
    mapping(uint256=>address)game_id_map;
    struct game_set
    {
        string sto_name;
        uint256 str_price;
        uint256 exp_time;
    }
    mapping(address=>mapping(uint256=>game_set))game_set_map;
    struct bet_no
    {
        uint256 num;
    }
    mapping(address=>bet_no)no_bets;
    function check_br() returns(bool newuser)
    {
        uint256 i=0;
        do
        {
            if(br_addr.length==0)
            {
                return true;
            }
            else if(br_addr[i]==msg.sender)
            {
                return false;
            }
            i++;
        }while(i<br_addr.length);
        return (true);
    }
    function add_br() returns (bool is_added)
    {
         br_map[msg.sender].st_amount=msg.value;
         br_addr.push(msg.sender);
         return true;
    }
    function br_set_game(string sto_name,uint256 str_price,uint256 exp_time) returns(bool newbet)
    {
        game_set_map[msg.sender][no_bets[msg.sender].num].sto_name=sto_name;
        game_set_map[msg.sender][no_bets[msg.sender].num].str_price=str_price;
        game_set_map[msg.sender][no_bets[msg.sender].num].exp_time=exp_time;
        game_id_map[game_id]=msg.sender;
        game_id++;
        no_bets[msg.sender].num++;
        return true;
    }
    function add_br_stake() returns(bool amount_added)
    {
        br_map[msg.sender].st_amount+=msg.value;
        return true;
    }
}
